import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  <div>
    <h1>
      <Link to="/home">
        <img src="FantasyFootball.png" alt="logo" />
      </Link>
    </h1>
    <h1> test</h1>
    <nav>
      <Link to="/home">Home</Link>
      <Link to="/members">Members</Link>
      <Link to="/stadings">Standings</Link>
    </nav>
  </div>;
};

export default NavBar;
